  `dataRange` int(2) default '1' COMMENT '0 全部数据，1 自己部门数据，2 自己和直属下级数据，3 自己下的所有数据',
  `login_ip` varchar(20) default NULL COMMENT '最后登陆IP',
  `login_date` datetime default NULL COMMENT '最后登陆时间',
  `remarks` varchar(100) default NULL COMMENT '备注信息',
  `sex` int(2) default '1' COMMENT '默认1 男  2 女',
  `birthday` date default NULL COMMENT '生日',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

